DROP TABLE IF EXISTS `t_bank_card_bin`;
CREATE TABLE `t_bank_card_bin` (
  `id` INT AUTO_INCREMENT COMMENT 'ID',
  `bank_code` VARCHAR(20) COMMENT '机构代码',
  `bank_name` VARCHAR(30) COMMENT '发卡行名称',
  `card_type` VARCHAR(30) COMMENT '卡类型 0：借记卡 1：信用卡',
  `card_name` VARCHAR(30) COMMENT '卡名',
  `card_bin` VARCHAR(10) COMMENT 'bin',
  `deleted` BIT COMMENT '是否删除 0：未删除 1：已删除',
  `version` INT COMMENT '版本编号',
  `created_by` INT COMMENT '创建者ID',
  `created_date` DATETIME COMMENT '创建时间',
  `last_modified_by` INT COMMENT '最后修改者ID',
  `last_modified_date` DATETIME COMMENT '最后修改者ID',
  PRIMARY KEY (`id`)
);

